                    this._div.innerHTML = 'Report on Environmental Sensitivity Mapping <br />Environmental Sensitivity Index (ESI) maps provide a concise summary of coastal resources that are at risk if an oil or chemical spill occurs nearby. Examples of at-risk resources include biological resources (such as birds and shellfish beds), sensitive shorelines (such as marshes and tidal flats), and human-use resources (such as public beaches and parks). <br />When a spill occurs, ESI maps can help responders meet one of the main response objectives: reducing the environmental consequences of the spill and the cleanup efforts. Additionally, ESI maps can be used by plannersbefore a spill happensto identify vulnerable locations, establish protection priorities, and identify cleanup strategies. <br />2019, the Department of Marine Administration (DMA) and Norwegian Coastal Administration (NCA) in Myanmar developed Environmental Sensitivity Mapping, with technical assistance from the Wildlife Conservation Society (WCS) and Fauna & Flora International (FFI). <br />For map layout development, we followed the IPECA guidelines for Sensitivity Mapping for Oil Spill Response and consulted the Environmental Sensitivity Index and ESI Atlas of the Gulf of Thailand. We developed Myanmar\'s coastline include the Coco Islands into 10 km x 10 km grid cells using ArcGIS software. Along Myanmar\'s coast, there are a total of 625 grid cells.<br /><br />Map Created by Kaung San, GIS Expert';
